"use strict";(self.webpackChunkkorpusy=self.webpackChunkkorpusy||[]).push([[53],{1109:o=>{o.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Lista korpus\xf3w","href":"/docs/intro","docId":"intro"},{"type":"category","label":"Korpusy og\xf3lne","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Narodowy Korpus J\u0119zyka Polskiego: NKJP1M","href":"/docs/korpusy-ogolne/nkjp1m","docId":"korpusy-ogolne/nkjp1m"},{"type":"link","label":"Narodowy Korpus J\u0119zyka Polskiego: NKJP300","href":"/docs/korpusy-ogolne/nkjp300","docId":"korpusy-ogolne/nkjp300"},{"type":"link","label":"Narodowy Korpus J\u0119zyka Polskiego: NKJP1800","href":"/docs/korpusy-ogolne/nkjp1800","docId":"korpusy-ogolne/nkjp1800"},{"type":"link","label":"Korpus \u201eS\u0142ownika frekwencyjnego polszczyzny wsp\xf3\u0142czesnej\u201d","href":"/docs/korpusy-ogolne/ksfpw","docId":"korpusy-ogolne/ksfpw"}],"href":"/docs/category/korpusy-og\xf3lne"},{"type":"category","label":"Korpusy historyczne","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Elektroniczny korpus tekst\xf3w polskich z XVII i XVIII w. (do 1772 r.)","href":"/docs/korpusy-historyczne/korba","docId":"korpusy-historyczne/korba"},{"type":"link","label":"Korpus tekst\xf3w polskich z lat 1830-1918","href":"/docs/korpusy-historyczne/korpus19","docId":"korpusy-historyczne/korpus19"},{"type":"link","label":"Korpus sejmikowy: dokumenty sejmikowe Rzeczypospolitej przedrozbiorowej","href":"/docs/korpusy-historyczne/sejmiki","docId":"korpusy-historyczne/sejmiki"}],"href":"/docs/category/korpusy-historyczne"},{"type":"category","label":"Korpusy tematyczne","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Korpus Dyskursu Parlamentarnego","href":"/docs/korpusy-tematyczne/kdp","docId":"korpusy-tematyczne/kdp"},{"type":"link","label":"Korpus Zale\u017cno\u015bci Referencyjnych","href":"/docs/korpusy-tematyczne/ppc","docId":"korpusy-tematyczne/ppc"},{"type":"link","label":"Sk\u0142adnica","href":"/docs/korpusy-tematyczne/skladnica","docId":"korpusy-tematyczne/skladnica"}],"href":"/docs/category/korpusy-tematyczne"},{"type":"category","label":"Korpusy obcoj\u0119zyczne","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"PAWUK: Polish Automatic Web corpus of UKrainian language","href":"/docs/korpusy-obcojezyczne/pawuk","docId":"korpusy-obcojezyczne/pawuk"}],"href":"/docs/category/korpusy-obcoj\u0119zyczne"}]},"docs":{"intro":{"id":"intro","title":"Lista korpus\xf3w","description":"Korpusy og\xf3lne","sidebar":"tutorialSidebar"},"korpusy-historyczne/korba":{"id":"korpusy-historyczne/korba","title":"Elektroniczny korpus tekst\xf3w polskich z XVII i XVIII w. (do 1772 r.)","description":"Elektroniczny Korpus Tekst\xf3w Polskich XVII i XVIII w. (do 1772 r.), w skr\xf3cie nazywany KorB\u0105 (akronim wyra\u017cenia korpus barokowy), jest najwa\u017cniejszym rezultatem projektu realizowanego w latach 2013-2018 przez Pracowni\u0119 Historii J\u0119zyka Polskiego XVII i XVIII w. Instytutu J\u0119zyka Polskiego PAN we wsp\xf3\u0142pracy z Zespo\u0142em In\u017cynierii Lingwistycznej w Instytucie Podstaw Informatyki PAN. Zgromadzone w nim teksty prezentowane s\u0105 w formie transkrypcji i transliteracji. Bogate metadane, znakowanie strukturalne i j\u0119zykowe oraz anotacja morfosyntaktyczna i lematyzacja daj\u0105 mo\u017cliwo\u015b\u0107 zadawania r\xf3\u017cnorakich zapyta\u0144, filtrowania wynik\xf3w oraz ich lokalizacji w \u017ar\xf3dle z dok\u0142adno\u015bci\u0105 do numeru strony.","sidebar":"tutorialSidebar"},"korpusy-historyczne/korpus19":{"id":"korpusy-historyczne/korpus19","title":"Korpus tekst\xf3w polskich z lat 1830-1918","description":"Korpus prezentowany na niniejszej stronie jest r\u0119cznie znakowanym fleksyjnie podzbiorem korpusu zgromadzonego w ramach projektu Automatyczna analiza \ufb02eksyjna tekst\xf3w polskich z lat 1830-1918 z uwzgl\u0119dnieniem zmian w odmianie i pisowni. Oryginalny korpus ma wielko\u015b\u0107 ponad 1 miliona s\u0142\xf3w i zosta\u0142 podzielny w r\xf3wnych proporcjach na pi\u0119\u0107 podkorpus\xf3w reprezentuj\u0105cych style funkcjonalne: popularnonaukowy, drobne wiadomo\u015bci prasowe, publicystyk\u0119, proz\u0119 i dramat. Do r\u0119cznej anotacji wybrano z niego 2944 pr\xf3bki d\u0142ugo\u015bci oko\u0142o 160 s\u0142\xf3w przy jednoczesnym zachowaniu proporcji styl\xf3w funkcjonalnych. W efekcie powsta\u0142 r\u0119cznie znakowany korpus obejmuj\u0105cy mniej wi\u0119cej po\u0142ow\u0119 oryginalnego zbioru (oko\u0142o 500 tys. s\u0142\xf3w, 625 tys. segment\xf3w).","sidebar":"tutorialSidebar"},"korpusy-historyczne/sejmiki":{"id":"korpusy-historyczne/sejmiki","title":"Korpus sejmikowy: dokumenty sejmikowe Rzeczypospolitej przedrozbiorowej","description":"Korpus dokument\xf3w sejmikowych Rzeczypospolitej przedrozbiorowej ma na celu zebranie wszystkich uchwa\u0142 (laud\xf3w) sejmikowych sprzed 1795 roku, na ile ich wydania s\u0105 dost\u0119pne i ich udost\u0119pnienie nie jest zakazane przez prawa autorskie. Poza tym korpus w\u0142\u0105cza inne dokumenty zwi\u0105zane z sejmikami (listy kr\xf3la i innych os\xf3b do sejmiku, dokumenty wydawane przez instytucje odpowiedzialne przed sejmikami) \u2013 je\u017celi takie dokumenty wydane zosta\u0142y razem z laudami sejmikowymi.","sidebar":"tutorialSidebar"},"korpusy-obcojezyczne/pawuk":{"id":"korpusy-obcojezyczne/pawuk","title":"PAWUK: Polish Automatic Web corpus of UKrainian language","description":"PAWUK is an acronym for Polish Automatic Web corpus of UKrainian language. It is a linguistic corpus containing Ukrainian texts acquired from the Internet (selected web pages and social network accounts) and is updated daily. It is automatically annotated with morphosyntactic tags, syntactic dependencies and named entities using Stanza with a custom-built model for Ukrainian to produce both Universal Dependencies tags and VESUM morphological tags.","sidebar":"tutorialSidebar"},"korpusy-ogolne/ksfpw":{"id":"korpusy-ogolne/ksfpw","title":"Korpus \u201eS\u0142ownika frekwencyjnego polszczyzny wsp\xf3\u0142czesnej\u201d","description":"Strona:","sidebar":"tutorialSidebar"},"korpusy-ogolne/nkjp1800":{"id":"korpusy-ogolne/nkjp1800","title":"Narodowy Korpus J\u0119zyka Polskiego: NKJP1800","description":"Pe\u0142ny korpus wszystkich tekst\xf3w zgromadzonych w ramach projektu Narodowego Korpusu J\u0119zyka Polskiego (nie jest zatem zr\xf3wnowa\u017cony). Stanowi nadzbi\xf3r korpusu NKJP300.","sidebar":"tutorialSidebar"},"korpusy-ogolne/nkjp1m":{"id":"korpusy-ogolne/nkjp1m","title":"Narodowy Korpus J\u0119zyka Polskiego: NKJP1M","description":"Strona: nkjp1m.nlp.ipipan.waw.pl/","sidebar":"tutorialSidebar"},"korpusy-ogolne/nkjp300":{"id":"korpusy-ogolne/nkjp300","title":"Narodowy Korpus J\u0119zyka Polskiego: NKJP300","description":"Zr\xf3wnowa\u017cony i reprezentatywny korpus obejmuj\u0105cy teksty polskie od pocz\u0105tku XX wieku do roku 2011.","sidebar":"tutorialSidebar"},"korpusy-tematyczne/kdp":{"id":"korpusy-tematyczne/kdp","title":"Korpus Dyskursu Parlamentarnego","description":"Korpus Dyskursu Parlamentarnego jest zbiorem anotowanych lingwistycznie tekst\xf3w z posiedze\u0144 plenarnych Sejmu i Senatu RP, interpelacji i zapyta\u0144 poselskich oraz posiedze\u0144 komisji od roku 1919 do chwili obecnej (s\u0105 stale uzupe\u0142niane materia\u0142ami z kolejnych posiedze\u0144). Teksty opisane metadanymi oraz przetworzone automatycznie narz\u0119dziami lingwistycznymi (do segmentacji, analizy morfosk\u0142adniowej, rozpoznawania grup sk\u0142adniowych i nazw w\u0142asnych) s\u0105 dost\u0119pne do przeszukiwania oraz pobrania.","sidebar":"tutorialSidebar"},"korpusy-tematyczne/ppc":{"id":"korpusy-tematyczne/ppc","title":"Korpus Zale\u017cno\u015bci Referencyjnych","description":"Strona: pcc.nlp.ipipan.waw.pl","sidebar":"tutorialSidebar"},"korpusy-tematyczne/skladnica":{"id":"korpusy-tematyczne/skladnica","title":"Sk\u0142adnica","description":"Strona: treebank.nlp.ipipan.waw.pl","sidebar":"tutorialSidebar"}}}')}}]);